public NodeId getNodeId() {
  UnRegisterNodeManagerRequestProtoOrBuilder p = viaProto ? proto : builder;
  if (this.nodeId != null) {
    return this.nodeId;
  }
  if (!p.hasNodeId()) {
    return null;
  }
  this.nodeId = convertFromProtoFormat(p.getNodeId());
  return this.nodeId;
}
